window.onload = () => {
    let sm = document.getElementById('small_player');
    let lg = document.getElementById('large_player');

    let control = new Hammer(sm);
    control.get('swipe').set({ direction: Hammer.DIRECTION_ALL });
    control.on("swipeup" , function(ev){
        sm.classList.toggle("active");
        setTimeout(() => {
            lg.classList.toggle("inlarge");
        }, 200);
    });

    let new_control = new Hammer(lg);
    new_control.get('swipe').set({ direction: Hammer.DIRECTION_ALL });
    new_control.on("swipedown" , function(ev){
        lg.classList.toggle("inlarge");
        setTimeout(() => {
            sm.classList.toggle("active");
        }, 200);
    });
};

function random_name(length){
    let arr = ["a","b","c","d","e","f","g","h","i","j","k","l","m","n","o","p","q","r","s","t","u","v","w","x","y","z"];
    let name = "";
    for(let i = 0 ; i < length ; i++){
        name += arr[Math.floor(Math.random()*arr.length)];
    }
    return name;
}

function remove_load(){
    let my_load_tab = document.getElementById("load_page");
    setTimeout(() => {
        my_load_tab.remove();
    }, 2000);
}

function open_menu() {
    let my_menu = document.getElementById('menu');
    my_menu.style.width = "100%";
    my_menu.style.height = "100%";
    my_menu.style.opacity = "1";
    setTimeout(() => {
        my_menu.style.transform = "translateX(0px)";
    }, 200);
    custom_alert("Menu need improvement!","1000","220px");
} 

function close_menu(){
    let my_menu = document.getElementById('menu');
    my_menu.style.transform = "translateX(-100%)";
    setTimeout(() => {
        my_menu.style.width = "100%";
        my_menu.style.height = "100%";
        my_menu.style.opacity = "0";
    }, 200);
}

function change_theme(num){
    let color_array = ["#ff453a","#30d158","#0a84ff","#de68ff","#f9d10c"];
    document.documentElement.style.setProperty("--my", color_array[num]);
    custom_alert("Theme Changed!","1000","150px");
}

function log_me(me){
    let parent = document.getElementById('logger');
    let img = document.getElementById('log_img');
    let parent_to = document.getElementById('logger-2');
    let img_to = document.getElementById('log_img_1');
    let src = "https://i.pinimg.com/originals/4f/db/f4/4fdbf4a2017595b576fba89abec29b43.jpg";
    let data = "Log in as <b> user/"+ random_name(8) +"</b>" ;
    img.src = src ;
    img_to.src = src ;
    if(me == "true"){
        parent.scrollTop = parent.scrollHeight ;
        parent_to.scrollTop = parent_to.scrollHeight ;
    }
    custom_alert(data ,"4000","250px");
}

function open_theme(){
    let want_open = document.getElementById('theme');
    setTimeout(() => {
        want_open.classList.toggle('vis');
    }, 200);
}

