function show_art(img_data , data , type){
    let tab = document.getElementById('artist_pre');
    let img = document.getElementById('big_img');
    let title = document.getElementById('art_title');
    let artist = document.getElementById('art_cat');
    tab.style.display = "flex";
    img.src = img_data ;
    title.innerHTML = data ;
    artist.innerHTML = type ;

    search_audio(data);
    custom_alert("data is loading","1000","150px");
}

function custom_alert(text , time , width){
    let div = document.createElement('DIV');
    div.setAttribute("class","custom_alert");
    div.innerHTML = text ;
    div.style.width = width ;
    document.body.appendChild(div);
    setTimeout(() => {
        div.remove();
    }, time);
}

async function search_audio(arg){
    let search = arg.trim();
    let url = `https://api.lyrics.ovh/suggest/${search}`;
    let data = await fetch(url)
                    .then(res => {
                        return res.json();
                    });
    let len = data.data.length ;
    let store = document.getElementById('data_list');

    for(let i = 0 ; i < len ; i++){
        store.innerHTML += `
            <li class="data_items">
                <div class="data_num">
                    <span>${i}</span>
                </div>
                <div class="data_data">
                    <p class="data_head">${data.data[i].title_short}</p>
                    <p>${data.data[i].artist.name}</p>
                </div>
                <div class="data_btn">
                    <span onclick="link_to('${data.data[i].title}')">link</span>
                </div>
            </li>
        `;
    }
}

function link_to(des){
   custom_alert("Opening song!","1000","200px");
   vibrate(25);
   setTimeout(() =>{
    window.open(`https://www.youtube.com/results?search_query=${des}`);
    },1000);
}

function art_toggle(){
    let tab = document.getElementById('artist_pre');
    let del = document.getElementById('data_list');
    tab.style.display = "none";
    del.innerHTML = "";
}

let isPlaying = false ;

function play_audio(src , type , i){
    let my_sm_player = document.getElementById('small_player');
    let my_lg_player = document.getElementById('large_player');
    let white_space = document.getElementById('white');
    let sm_img = document.getElementById('sm_player_img');
    let sm_title = document.getElementById('sm_player_name');
    let sm_art = document.getElementById("sm_player_art");
    let lg_img = document.getElementById('lg_player_img');
    let lg_title = document.getElementById('lg_player_name');
    let lg_art = document.getElementById("lg_player_art");
    let player = document.getElementById('my_music');
    let player_src = document.getElementById('my_music_file');

    switch (type){
        case "bg":
                sm_img.src = lg_music[i].sm_img ;
                sm_title.innerHTML = lg_music[i].music_name;
                sm_art.innerHTML = lg_music[i].music_art ;
                lg_img.src = lg_music[i].sm_img ;
                lg_title.innerHTML = lg_music[i].music_name;
                lg_art.innerHTML = lg_music[i].music_art ;
            break;
        case "eng":
                sm_img.src = eng_music[i].img ;
                sm_title.innerHTML = eng_music[i].name;
                sm_art.innerHTML = eng_music[i].artist ;
                lg_img.src = eng_music[i].img ;
                lg_title.innerHTML = eng_music[i].name;
                lg_art.innerHTML = eng_music[i].artist ;
            break;
        case "k-pop":
                sm_img.src = k_pop_music[i].img ;
                sm_title.innerHTML = k_pop_music[i].name;
                sm_art.innerHTML = k_pop_music[i].artist ;
                lg_img.src = k_pop_music[i].img ;
                lg_title.innerHTML = k_pop_music[i].name;
                lg_art.innerHTML = k_pop_music[i].artist ;
            break;
        case "spain":
                sm_img.src = spain_music[i].img ;
                sm_title.innerHTML = spain_music[i].name;
                sm_art.innerHTML = spain_music[i].artist ;
                lg_img.src = spain_music[i].img ;
                lg_title.innerHTML = spain_music[i].name;
                lg_art.innerHTML = spain_music[i].artist ;
            break;
        case "anime":
                sm_img.src = anime_music[i].img ;
                sm_title.innerHTML = anime_music[i].name;
                sm_art.innerHTML = anime_music[i].artist ;
                lg_img.src = anime_music[i].img ;
                lg_title.innerHTML = anime_music[i].name;
                lg_art.innerHTML = anime_music[i].artist ;
    }
    my_sm_player.style.transform = "translateY(0px)";
    white_space.style.display = "block";
    isPlaying = true ;
    player_src.src = src ;
    player.load();
    toggle_con();
    fav("can");
}

function search_song(){
    let input = document.getElementById('search-txt');
    let search_txt = input.value.trim();
    if(search_txt != "" && search_txt.length > 3){
        link_to(search_txt);
        input.value = "";
    } else {
        input.value = "";

    }
}

function toggle_con(){
    let sm = document.getElementById('my_play');
    let lg = document.getElementById('my_play_1');
    let player = document.getElementById('my_music');
    if (sm.classList.contains("done") && lg.classList.contains("done") && isPlaying == false) {
        sm.innerHTML = "pause";
        lg.innerHTML = "pause";
        sm.classList.toggle("done");
        lg.classList.toggle("done");
        player.play();
        isPlaying = true ;
    } else {
        sm.innerHTML = "play_arrow";
        lg.innerHTML = "play_arrow";
        sm.classList.toggle("done");
        lg.classList.toggle("done");
        player.pause();
        isPlaying = false ;
    }
}

function fav(what){
    let me = document.getElementById('heart');
    switch (what){
        case "can":
            me.classList.toggle("fav");
            break;
        case "do":
            me.classList.toggle("fav");
            vibrate(25);
            custom_alert("favorite","1000","90px");
    }
}

let checkVibrate = window.navigator && window.navigator.vibrate;

function vibrate(time){
   if (checkVibrate)navigator.vibrate(time);
}

function volume(me){
    let player = document.getElementById('my_music');
    if(me.classList.contains("cont_t")){
        me.innerHTML = "volume_up";
        me.classList.toggle("cont_t");
        player.volume = 0.8 ;
        vibrate(25);
    } else{
        me.innerHTML = "volume_down";
        me.classList.toggle("cont_t");
        player.volume = 0.25 ;
        vibrate(25);
    }
}

function skip(type){
    let player = document.getElementById('my_music');
    let duration = player.duration - 5;
    let currentime = player.currentTime ;
    if(currentime > 5 && currentime < duration){
        switch (type){
            case "neg":
                player.currentTime -= 5;
            break;
            case "pos":
                player.currentTime += 5;
            break;
        }
        vibrate(25);
    }
}
